import { render } from '@testing-library/react';
import React, { Component } from 'react';


const AppBar = () => {
     handleClick = () => {
        console.log('cieto error');
      }    
    const Menu = props => (
        <div id="appBar">
            <button onClick={this.handleClick}>
                Click me
            </button>
             <h2 id="titulo"  >Wdemy </h2> 
        </div>
      )
    render (
        <>
           <div id="menu">
               <Menu />
           </div>
        </>
    )
}

export default AppBar
